import React, { useState, useEffect } from 'react'

const Evolution = ({ pokemonID, species }) => {
    const [evolution, setEvolution] = useState(null);
    let evolutionPhase = [species];

    const fetchEvolution = () => {
        fetch(`http://localhost:8080/pokemonEvolution/${pokemonID}`)
            .then(async res => {
                const evolution = await res.json();
                setEvolution(evolution.chain);
            })
    }

    useEffect(() => fetchEvolution(), []);

    if (evolution !== null) {

        evolution.evolves_to.map(evolve => {
            if (evolve.species) {

                evolutionPhase = [...evolutionPhase, evolve.species];
            }
            return evolve.species
        })
    }

    console.log(evolution, '== Evolution ==')
    console.log(evolutionPhase)

    return (
        <div></div>
    )
}

export default Evolution;
